import React from 'react';

export default function About (){
    return (
        <div id="about" className='about'>
            <h3>Little about me:</h3>
                <p>Hello! I'm Abigail. I have been sitting dogs for the past 10 years. I have lots of experience with grooming, training, and sitting dogs. </p>
        </div>
    )
}
